import styled from 'styled-components';

const Border = styled.div`
overflow: hidden;
background: transparent;
margin: 15px 0px;
position: absolute;
left: 0px;
width: 25%;
height: 100%;
border-right: 2px solid black;
`

const InfoContainer = styled.div`
overflow: hidden;
overflow-y: scroll;
background: transparent;
margin: 15px 0px;
position: absolute;
left: 0px;
width: 100%;
height: 200px;
`;

export const TH = styled.th`
width: 12.5%;
height: 20px;
border-bottom: 1px solid black;
border-left: 1px solid black;
border-right: 1px solid black;
background-color: darkgray;
`

export const TR = styled.tr`
width: 100%;
height: 40px;
border-bottom: 1px solid black;
`

export const TD = styled.td`
background-color: lightgrey;
width: 12.5%;
height: 20px;
border-bottom: 1px solid black;
border-left: 1px solid black;
border-right: 1px solid black;
text-align: center;
`

export const Table = styled.table`
width: 100%;
height: 100%;
overflow-y: scroll;
overflow: hidden;
`

const Label1 = styled.h1`
margin-left: 5%;
margin-top: 1%;
font-size: 175%;
text-align: left;
font-weight: normal;
`
const styleGray = {backgroundColor : '#AFAFAF'};

const LeftThird = () => {
    return (
        <Border>
            <Label1> Attraction Intervals </Label1>
                <InfoContainer>
                <table className="table table-bordered table-striped">
        <thead>
          <tr style = {styleGray}>
            <th scope="col">Property</th>
            <th scope="col">Value</th>
          </tr>
        </thead>
        <tbody>

        <tr>
        <td>Name</td>
        <td>                 
                <input type='text' name='ride_name' onChange={(e) => {

                }}></input> </td>
        </tr>

        <tr>
        <td>Model</td>
        <th> 
              <input type='text' name='rideModel' onChange={(e) => {
            
                      }}></input>
        </th>
        </tr>

        <tr>
        <td>Area</td>
        <th> 
            <input type='text' name='rideArea' onChange={(e) => {
               
                    }}></input>
        </th>
        </tr>

        <tr>
        <td>Theoretical Capacity</td>
        <th> 
            <input type='number' name='theoryCapacity' onChange={(e) => {
                    
                        }}></input>
        </th>
        </tr>

        <tr>
        <td>Target Capacity</td>
        <th> 
            <input type='number' name='targetCapcity' onChange={(e) => {
                
                        }}></input>  
        </th>
        </tr>

        <tr>
        <td>Max Vehicles</td>
        <th>
            <input type='number' name='maxVehicles' onChange={(e) => {
                        
                        }}></input>
        </th>
        </tr>

        <tr>
        <td>Min Vehicles</td>
        <th>
            <input type='number' name='minVehicles' onChange={(e) => {
                
                        }}></input>
        </th>
        </tr>

        <tr>
        <td>Seats per Vehicle</td>
        <th>
            <input type='number' name='maxSeats' onChange={(e) => {
                   
                        }}></input>
        </th>
        </tr>

        <tr>
        <td>Max Employees</td>
        <th>
            <input type='number' name='maxStaff' onChange={(e) => {
                      
                        }}></input>
        </th>
        </tr>

        <tr>
        <td>Min Employees</td>
        <th>
            <input type='number' name='minStaff' onChange={(e) => {
                   
                        }}></input>
        </th>
        </tr>

        <tr>
        <td>Power Requirement</td>
        <th>
              <input type='text' name='powerReq' onChange={(e) => {
                            setPowerReq(e.target.value);
                          }}></input>
        </th>
        </tr>

        <tr>
        <td>Max Height</td>
        <th>
              <input type='text' name='maxHeight' onChange={(e) => {
                            setMaxHeight(e.target.value);
                          }}></input>
        </th>
        </tr>

        <tr>
        <td>Track Length</td>
        <th>
            <input type='text' name='trackLength' onChange={(e) => {
                          setTrackLength(e.target.value);
                        }}></input>
        </th>
        </tr>
        
        </tbody>

        </table>
                    </InfoContainer>    
 
        </Border>
    )
}

export default LeftThird
